// Default imports
import React, {Component} from 'react';

// Custom imports
import Nav from '../navbar/navbar';
import {connect} from "react-redux";
import * as personalInfo from './actions/action';

class About extends Component {
    // Component load
    componentDidMount() {
        this.props.GetAbilities();
    }

    renderAbilities = () => {
        const {abilities} = this.props;
        return abilities.map(ability=>(
            // Html build here
            <div className='card hoverable'>
                <div className='card-content'>
                    <span className="card-title">{ability.title}</span>
                    {ability.abilityDescription}
                    <div className="card-action">
                        <span className='blue-text'>{repo.language}</span>
                        <span> â€¢ Latest commit at: {new Date(repo.pushed_at).toUTCString().slice(0, 25)}</span>
                        <span className='right'>
                                {repo.default_branch}
                            <GoGitBranch size={14}/>
                        </span>
                    </div>
                </div>
            </div>
        ));
    };

    render() {
        return (
            // HTML here
            <div>
                <Nav/>
                <div className='container'>
                    About
                </div>
            </div>
        )
    };
}

const mapStateToProps = (state) => {
    return state;
};
// Default export
export default connect(mapStateToProps, personalInfo)(About);
